import React from 'react';
import './App.css';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import TabPanel from '@material-ui/lab/TabPanel';
import FunctionsOutlinedIcon from '@material-ui/icons/FunctionsOutlined';
import EqualizerOutlinedIcon from '@material-ui/icons/EqualizerOutlined';
import Header from './components/Header';
import ReverseMax from './components/ReverseMax';
//import CalculationModal from './components/CalculationModal';


function App() {

  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <div className="App">


    <Header/>

    <Grid container direction="row" justify="center" alignItems="center">

    <Grid container item xs={12} justify="center" alignItems="center"><ReverseMax/></Grid>

    </Grid>

 <Grid container direction="row" justify="center" alignItems="center">
    <div style={{position: "fixed", bottom:"0", width:'100%'}}>
      <Paper variant="outlined" square>
        <Tabs indicatorColor="primary" value={value} onChange={handleChange} variant="fullWidth" centered>
          <Tab label="Calculator" icon={<FunctionsOutlinedIcon/>} />
          <Tab label="Data" icon={<EqualizerOutlinedIcon/>}/>
        </Tabs>
      </Paper>
    </div>
  </Grid>
      <TabPanel value={value} index={0}>
        Item One
      </TabPanel>
      <TabPanel value={value} index={1}>
        Item Two
      </TabPanel>



    </div>
  );
}

export default App;
